sys_script_include.script:
var Democ = Class.create();
Democ.prototype = Object.extendsObject(AbstractAjaxProcessor, {

    getAssetTag : function() {
    var g=new GlideRecord('cmdb_ci');
	g.addQuery("sys_id",this.getParameter('sysparm_assetTag'));
	g.Query();
	if(g.next())

		{
			return g.getDisplayValue('asset_tag');
		}
    },

    type: 'Democ'
});
